	return(
	 <React.Fragment>

	<div className= 'tc dib br3 pa3 ma2 grow bw2 shadow-5'>
	     <NavLink to = "/OxygenTherapy"> 
		  <button className= 'navigationButton'><img className= 'navigationImage' src alt= 'mask' src={require('./mask.jpg')}/> 
		  </button><h2 className = "text" > 
		{'Oxygen Therapy'}
		</h2>
		 </NavLink>
		</div>


	<div className= 'tc dib br3 pa3 ma2 grow bw2 shadow-5'>
	     <NavLink to = "/ABG">
		  <button className= 'navigationButton'><img className= 'navigationImage'src alt= 'ABG' src={require('./ABG.jpg')}/> 
		  </button><h2 className = "text"> 
		Arterial Blood Gas </h2>
		 </NavLink>

		</div>	
		</React.Fragment>



		);
	}
}


